import React from 'react';
import Footer from './Footer.js';

const Contact = () => {
  return (
    <div className='page'>
      <div className='page-content'>
        <div className='text-box'>
          <h1 className='main-title text-center'>Get in touch</h1>
          <p className='text text-center'>I would love to hear from you. Feel free to send me an email or check out any of my social media accounts via the buttons below</p>
          <Footer />
        </div>
      </div>
    </div>

  );
}

export default Contact;
